import React from 'react';

import './DraggableList.css';

const DraggableList = () => {

let array = [
    {
        id: 'list-1',
        title: 'Automatic',
        thumb: '/path/to/icon'
    },
    {
        id: 'list-2',
        title: 'Automatic',
        thumb: '/path/to/icon'
    }
]

  return (
    <>
      <ul className="myList">
        {array.map(({id, title, thumb}, index) => {
            return (
            <li key={id}>
                    {index+1 +". "}
                { title }
            </li>
            );
        })}
        </ul>
    </>
  )
}

export default DraggableList;
